// src/components/Feedback.js
import React from 'react';

function Feedback() {
  return (
    <div>
      <h2>Feedback</h2>
      <form>
        <label>
          Your Feedback:
          <textarea name="feedback"></textarea>
        </label>
        <button type="submit">Submit Feedback</button>
      </form>
    </div>
  );
}

export default Feedback;
